import React, { setState } from 'react';
import PropTypes from 'prop-types';
import { withStyles, makeStyles } from '@material-ui/core/styles';
import { stylesContent } from "../styles/Styles"
import Grid from '@material-ui/core/Grid';
import NavPills from '../../../components/NavPills/NavPills';
import { Dashboard } from '@material-ui/icons';
import Schedule from "@material-ui/icons/Schedule";

const useStyles = makeStyles(() => ({
  div: {
    color: "black",
    fontFamily: "Helvetica",
    fontSize: "40px",
    textAlign: "center",
    position: "absolute",
    top: "50%"
  }


}));

function TestList(props) {

  return (

    <Grid container style={{height: '100vh'}}>
        <NavPills style={{position:"absolute"}} color="adminDashboard" tabs={[{
          tabButton: "Test de niveau",
          tabIcon: Schedule
        }, {
          tabButton: "Test de profile d'apprentissage",
          tabIcon: Dashboard
        }]} />

      </Grid>

      /* <TestPage /> */


  );
}

TestList.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(stylesContent)(TestList);
